import React from 'react';

const SearchUI = ({searchInput, handleChange, handleSubmit, showError}) => {
    return (
        <div>
            <input 
                value={searchInput}
                onChange={handleChange}/>
            <button onClick={handleSubmit}>Узнать</button>
            {showError && 'Введите город'}
        </div>
    )
}

export default SearchUI
